import React, {Component} from 'react';
import {Button,  Form} from "react-bootstrap";
import axios from 'axios';

class Home extends Component {
    constructor(props) {
        super(props);
        this.state={
            login : false,
            dok : [],
            optionurl : ''
        }

    }
    componentDidMount() {
        axios({
            method: 'get',
            url: this.state.optionurl,
        }).then((response) => {
            this.setState({doks: response.data})
            console.log(response.data)

        }).catch((error) => {
            console.log(error)
        });
    }

    render() {
        if (this.props.login > 0)
            return (
                <div className="data-in-page">
                    <Form action={"http://localhost:8081/doks/datasort"} method="post" className="dokdate">
                    <td><Form.Control type="datetime-local" placeholder="Enter Data" name="data1" /></td>
                    <td><Form.Control type="datetime-local" placeholder="Enter Data" name="data2" /></td>
                        <td><Button variant="outline-info" type="submit" className="dokdate"> Ok </Button></td>
                    </Form>
                </div>
            );
        else
            return (
                <div className="data-in-page"> <h2 class="text-danger">Login error</h2></div>
            );
    }
}

export default Home;
